import { useRouter } from 'next/router'
import withLayout from '../components/Layout'


const Post = () => {
  const router = useRouter()
  return (
    <div>
      <h1>{ router.query.title }</h1>
      <p>This is the blog content.</p>
    </div>
  )
}

export default withLayout(Post)
